INSERT INTO `jobs` (`id`, `job_title`, `job_description`, `job_type`, `designation`, `department`, `salary`, `shift`, `education`, `experience`, `no_of_vacancies`, `work_remotely`, `start_date`, `end_date`, `status`, `added_by`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Business Analyst', '<p>Job description for Business Analyst :</p>\r\n\r\n<p>.Should have good knowledge of online bidding on portals (Freelancer, and Upwork).<br />\r\n.Must have experience working as a BA interfacing with technical teams.<br />\r\n.Experience writing and reviewing business processes, functional design and working among development teams.<br />\r\n.Should have good working knowledge of SRS and other documentation.<br />\r\n.Strong analytical skills to ask the &ldquo;right questions&rdquo;; excellent requirement gathering and analysis skills.<br />\r\n.Ability to work under extremely pressured condition and produce required result.<br />\r\n.Result driven individual with the ability to manage stress effectively.<br />\r\n.Time management skills; and the ability to prioritize tasks.</p>\r\n\r\n<p><br />\r\n&bull; Publishing documentation in the format required for project delivery.<br />\r\n&bull; Communication between the Client and the Technical teams.<br />\r\n&bull; Writing case studies and blogs for the projects and websites developed.<br />\r\n&bull; Generating Revenue &amp; projects and closing deals with International Clients.<br />\r\n&bull; Assists in enforcement of project deadlines and schedules.<br />\r\n&bull; Quickly understands the business issues and data challenges of client&rsquo;s organization and industry.<br />\r\n&bull; Creating documents like BRS /SRS and project Cost Estimation<br />\r\n&bull; Identifies client organizations strengths and weaknesses and suggests areas of improvement.<br />\r\n&bull; Reviewing documents for language, punctuation, and style or formatting errors with proficiency.<br />\r\n&bull; Technical Recommendation and Testing</p>', 'full_time', 6, 2, 3, '1', '1', '1', 2, 'yes', '2022-04-01', '2022-04-30', 1, 34, '2022-04-01 12:08:13', '2022-04-01 12:08:13', NULL),
(2, 'PHP Team leader', '<p>--Job Description:</p>\r\n\r\n<p>Preferred candidate should be confident and should have willingness to undertake multiple challenges and should have strong desire to emerge as winner in handling crucial situations.</p>\r\n\r\n<p>1. Should be capable of handling multiple PHP projects.</p>\r\n\r\n<p>2. Should be efficient enough to utilize the resources available to him.</p>\r\n\r\n<p>3. Analyze client requirements and prepare scope of work and time frame accordingly.</p>\r\n\r\n<p>4. Can handle and plan project milestones and deadlines.</p>\r\n\r\n<p>5. Should be able to interact with client during entire project development life cycle.</p>', 'full_time', 8, 4, 5, '1', '1', '2', 2, 'yes', '2022-04-01', '2022-05-31', 1, 34, '2022-04-01 12:10:23', '2022-04-01 12:10:23', NULL),
(3, 'PHP Developer', '<p>RG Infotech, is currently seeking enthusiastic PHP Developers for ,who would be responsible for CI/Cake/Laravel development . Check details here!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Requirements :-</p>\r\n\r\n<ul>\r\n	<li>Good knowledge of HTML, CSS, Javascript, AJAX etc.</li>\r\n	<li>Proficient with PHP, MYSQL, AJAX, JavaScript, JQuery, HTML/CSS</li>\r\n	<li>Knowledge of Laravel, Codeigniter, WordPress will be preferred.</li>\r\n	<li>Candidate must have good analytical and problem solving skills and should be able to work under tight deadlines.</li>\r\n	<li>Solve complex performance problems and architectural challenges</li>\r\n	<li>Understanding of MVC design patterns</li>\r\n	<li>Understanding of front-end technologies such as HTML5, CSS</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Job Responsibilities :-</p>\r\n\r\n<ul>\r\n	<li>Follow good industry practices and coding protocols</li>\r\n	<li>Contribute in all phases of the development life-cycle</li>\r\n	<li>Work under supervision of Sr. Developer/Team Leader</li>\r\n	<li>Writing clean, fast PHP to a high standard, in a timely and scalable manner</li>\r\n	<li>Develop and deploy new features to facilitate related procedures and tools if necessary</li>\r\n	<li>Producing detailed project specifications</li>\r\n	<li>Troubleshooting, testing and maintaining the core product software and databases</li>\r\n</ul>', 'full_time', 7, 4, 3, '1', '1,3', '2', 3, 'yes', '2022-04-04', '2022-04-05', 1, 34, '2022-04-04 12:00:47', '2022-04-04 12:00:47', NULL),
(4, 'Ios', '<h3>RG Infotech, is currently seeking an experienced iOS Developer. You would be responsible for the development of iOS applications. Check out more here!</h3>\r\n\r\n<p>Experience : 6 months to 2 years</p>\r\n\r\n<p>Job Role :&nbsp;Full-Time</p>\r\n\r\n<p>Location :&nbsp;Jaipur,&nbsp;IN</p>\r\n\r\n<hr />\r\n<p>Requirements :-</p>\r\n\r\n<ul>\r\n	<li>Proven experience with Objective-C/Swift, Foundation, Core Data, UIKit, CFNetwork, CoreFoundation, Security and WebKit</li>\r\n	<li>Should have worked on REST API, TCP, HTTP, SOAP, JSON and service integration.</li>\r\n	<li>Should be able to use Git for source control (GitHub, GitLab, BitBucket)</li>\r\n	<li>Good knowledge of object-oriented programming and project patterns</li>\r\n	<li>Experience with third-party libraries and APIs</li>\r\n	<li>Knowledgeable of the app publication and configuration process in App Store</li>\r\n	<li>Proficient with Swift Latest version {{depending on project requirements}}, and Cocoa Touch</li>\r\n	<li>Experience with iOS frameworks such as Core Data, Core Animation, etc.</li>\r\n	<li>Experience with offline storage, threading, and performance tuning</li>\r\n	<li>Knowledge of other web technologies and UI/UX standards</li>\r\n	<li>Understanding of Apple&rsquo;s design principles and interface guidelines</li>\r\n	<li>Should be very good in communication, so as to interact with clients</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Job Responsibilities :-</p>\r\n\r\n<ul>\r\n	<li>Develop &amp; maintain features and applications that will excite</li>\r\n	<li>Ensure project efforts proceed efficiently and in the right direction</li>\r\n	<li>Meet deadlines and address project risks and plan for contingencies</li>\r\n	<li>Build iOS solutions that commit to high quality and latest trends</li>\r\n	<li>Participate in direct meetings and teleconferences with product owners and clients</li>\r\n	<li>Participate in peer reviews of designs and code of other teams</li>\r\n	<li>Assist with business analysis, requirements gathering of scope/concept documents</li>\r\n</ul>', 'full_time', 10, 4, 2, '1', '1,3', '1', 2, 'no', '2022-04-27', '2022-06-30', 1, 34, '2022-04-27 10:58:36', '2022-04-27 10:58:36', NULL),
(5, 'Digital Marketing Executive', '<p>Responsibilities<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Plan and execute all digital marketing, including SEO/SEM, marketing database, email, social media and display advertising campaigns<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Design, build and maintain our social media presence<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Measure and report performance of all digital marketing campaigns, and assess against goals (ROI and KPIs)<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Identify trends and insights, and optimize spend and performance based on the insights<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Brainstorm new and creative growth strategies<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Plan, execute, and measure experiments and conversion tests<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Collaborate with internal teams to create landing pages and optimize user experience<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Instrument conversion points and optimize user funnels<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Evaluate emerging technologies. Provide thought leadership and perspective for adoption where appropriate</p>\r\n\r\n<p><br />\r\nRequirements and skills<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Proven working experience in digital marketing<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Demonstrable experience leading and managing SEO/SEM, marketing database, email, social media and/or display advertising campaigns<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Highly creative with experience in identifying target audiences and devising digital campaigns that engage, inform and motivate<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Experience in optimizing landing pages and user funnels<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Experience with A/B and multivariate experiments<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Solid knowledge of website analytics tools&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Experience in setting up and optimizing Google Adwords campaigns<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Strong analytical skills and data-driven thinking<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Up-to-date with the latest trends and best practices in online marketing and measurement</p>', 'full_time', 3, 3, 2, '1', '1,3', '2', 1, 'no', '2022-05-26', '2022-05-27', 1, 34, '2022-05-26 13:18:38', '2022-05-26 13:18:38', NULL),
(6, 'Frontend Developer', '<p>We are looking for a qualified Front-end developer to join our IT team.</p>\r\n\r\n<h2>Responsibilities</h2>\r\n\r\n<ul>\r\n	<li>Use markup languages like HTML to create user-friendly web pages</li>\r\n	<li>Maintain and improve website</li>\r\n	<li>Optimize applications for maximum speed</li>\r\n	<li>Design mobile-based features</li>\r\n	<li>Collaborate with back-end developers and web designers to improve usability</li>\r\n	<li>Get feedback from, and build solutions for, users and customers</li>\r\n	<li>Write functional requirement documents and guides</li>\r\n	<li>Create quality mockups and prototypes</li>\r\n	<li>Help back-end developers with coding and troubleshooting</li>\r\n	<li>Ensure high quality graphic standards and brand consistency</li>\r\n	<li>Stay up-to-date on emerging technologies</li>\r\n</ul>\r\n\r\n<h2>Requirements and skills</h2>\r\n\r\n<ul>\r\n	<li>Proven work experience as a Front-end developer</li>\r\n	<li>Hands on experience with markup languages</li>\r\n	<li>Experience with JavaScript, CSS and jQuery</li>\r\n	<li>Familiarity with browser testing and debugging</li>\r\n	<li>In-depth understanding of the entire web development process (design, development and deployment)</li>\r\n	<li>Understanding of layout aesthetics</li>\r\n	<li>Knowledge of SEO principles</li>\r\n	<li>Familiarity with software like Adobe Suite, Photoshop and content management systems</li>\r\n	<li>An ability to perform well in a fast-paced environment</li>\r\n	<li>Excellent analytical and multitasking skills</li>\r\n	<li>BSc degree in Computer Science or relevant field</li>\r\n</ul>', 'full_time', 18, 5, 1, '1', '1', '1', 1, 'no', '2022-06-15', '2022-06-25', 1, 34, '2022-06-15 11:00:36', '2022-06-15 11:00:36', NULL),
(7, 'Quality Analyst', '<h2><strong>requirements and experience&nbsp;</strong></h2>\r\n\r\n<p>Now that you are aware of the responsibilities of a quality analyst, let&rsquo;s take a look at the educational qualification to become the one.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2-4 years of proven experience in the software testing domain&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Bachelor&rsquo;s degree in computer science, management information, or any other related field</li>\r\n	<li>3 years of quality analyst technical experience&nbsp;</li>\r\n	<li>Comprehensive knowledge of tools, concepts, and associated methodologies of QA</li>\r\n	<li>Proven skills in QA applications, databases, and Microsoft office</li>\r\n	<li>Certification like Quality Engineer, Quality Auditor, Six Sigma, and Quality Improvement associate</li>\r\n</ul>', 'full_time', 22, 7, 2, '1', '1,3', '1', 1, 'no', '2022-06-16', '2022-08-24', 1, 34, '2022-06-16 10:32:07', '2022-06-16 10:32:07', NULL);
